import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Sidebar from './Sidebar';
import VehicleList from './VehicleList';

function AdminDashboard() {
  const [users, setUsers] = useState([]);
  const [vehicles, setVehicles] = useState([]);

  useEffect(() => {
    const fetchUsersAndVehicles = async () => {
      try {
        const usersResponse = await axios.get('http://localhost:5000/api/users');
        if (Array.isArray(usersResponse.data.users)) {
          setUsers(usersResponse.data.users);
        } else {
          console.error('The users data is not an array');
          setUsers([]);
        }

        const vehiclesResponse = await axios.get('http://localhost:5000/api/vehicles');
        if (Array.isArray(vehiclesResponse.data.vehicles)) {
          setVehicles(vehiclesResponse.data.vehicles);
        } else {
          console.error('The vehicles data is not an array');
          setVehicles([]);
        }

      } catch (error) {
        console.error('Error fetching data', error);
      }
    };

    fetchUsersAndVehicles();
  }, []);

  return (
    <Router>
      <div className="dashboard-container">
        <Sidebar />

        <div className="main-content">
          <Switch>
            <Route path="/vehicles">
              <h2>Vehicles</h2>
              <VehicleList vehicles={vehicles} />
            </Route>
            <Route path="/users">
              <h2>Users</h2>
              {Array.isArray(users) && users.length > 0 ? (
                <ul>
                  {users.map((user) => (
                    <li key={user._id}>{user.name} - {user.email}</li>
                  ))}
                </ul>
              ) : (
                <p>No users found</p>
              )}
            </Route>
            <Route path="/booking">
              <h2>Booking</h2>
              {/* Add Booking Component here */}
            </Route>
            <Route path="/">
              <h1>Home</h1>
              <p>Welcome to the Admin Dashboard</p>
            </Route>
          </Switch>
        </div>
      </div>
    </Router>
  );
}

export default AdminDashboard;
